Zamów album "Zapracowany Obibok 2014" tutaj http://preorder.pl/muzyka/hip-hop-polska/cira-zapracowany-obibok Cira na fb: https://www.facebook.com/cira1983

"Słowotok 2" to kontynuacja utworu o tym samym tytule sprzed 10-u lat, który zasilił pierwsze wydanie albumu "Zapracowany Obibok", wtedy jeszcze nielegala z białostockiego podziemia. Cira z pomocą EljotSounds nagrał kontynuację utworu, którą następnie umieścił na reedycji płyty.

"Zapracowany Obibok 2014" to reedycja wydanej w 2005 roku klasycznej pozycji z dyskografii Ciry. Ten album to od kilku lat niedostępny nigdzie debiut białostockiego rapera. Biały kruk polskiego podziemia hip-hopowego.Do reedycji został dołączony bonusowy track pt. „Słowotok 2" wyprodukowany przez EljotSounds. 

Album promuje teledysk „Cirap" nakręcony w Paryżu pod koniec 2013 roku. Za muzykę na płycie odpowiada Auer, Markoś, Dejot i Szafran.Wydanie: digipack. Premiera 28 lutego 2014 roku. Wydawca Step Records.

